"use strict";

// accordion

var vacancyItem = document.querySelectorAll('.vacancy__item');
var vacancyPrice = document.querySelector('.vacancy__price');
vacancyItem.forEach(function (item) {
  item.addEventListener('click', function () {
    var self = item.querySelector('.vacancy__text');
    var arrow = item.querySelector('.vacancy__price');
    self.classList.toggle('vacancy__text--active');
    arrow.classList.toggle('vacancy__price--active');
  });
});
"use strict";

// Бургер меню
var burger = document.querySelector('.burger');
var burgerLine = document.querySelectorAll('.burger__line');
var menu = document.querySelector('.header__menu');
var menuLinks = menu.querySelectorAll('.header__elem-link');
burger.addEventListener('click', function () {
  burger.classList.toggle('burger--active');
  menu.classList.toggle('header__menu--active');
  document.body.classList.toggle('stop-scroll');
});
menuLinks.forEach(function (el) {
  el.addEventListener('click', function () {
    burger.classList.remove('burger--active');
    menu.classList.remove('header__menu--active');
    document.body.classList.remove('stop-scroll');
  });
});
// Выпадающий список header
var headerItem = document.getElementsByClassName('header__item');
var headerList = document.querySelectorAll('.header__list');
var headerLink = document.querySelectorAll('.header__link');
if (window.innerWidth > 1024) {
  for (var i = 0; i < headerItem.length; i++) {
    headerItem[i].addEventListener("mouseover", showSub, false);
    headerItem[i].addEventListener("mouseout", hideSub, false);
  }
} else {
  headerList.forEach(function (el) {
    el.classList.add('hide');
  });
  headerLink.forEach(function (elem) {
    elem.addEventListener('click', function () {
      elem.nextElementSibling.classList.toggle('hide');
    });
  });
}
function showSub(e) {
  if (this.children.length > 1) {
    this.children[1].style.display = "block";
    this.children[1].style.height = "auto";
    this.children[1].style.overflow = "visible";
    this.children[1].style.opacity = "1";
    this.children[1].style.padding = "15px 15px 25px";
  } else {
    return false;
  }
}
function hideSub(e) {
  if (this.children.length > 1) {
    this.children[1].style.height = "0px";
    this.children[1].style.overflow = "hidden";
    this.children[1].style.opacity = "0";
    this.children[1].style.padding = "0";
    this.children[1].style.display = "none";
  } else {
    return false;
  }
}
